import "./AdminPage.css";

function AdminPage() {
  return (
    <div className="AdminPage">
      <div className="AdminColumn">
        <h1>Name:</h1>
      </div>
      <div className="AdminColumn">
        <input></input>
      </div>
    </div>
  );
}

export default AdminPage;
